function drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray){
    for (let i = 0; i < bufferLength; i++) {
         barHeight = dataArray[i] * 1.2;
         barWidth = dataArray[i] * 0.4;
         ctx.save();
         let x = Math.sin(i/30 * Math.PI / 180) * 200;
         let y = Math.cos(i/30 * Math.PI / 180) * 200;
         ctx.translate(canvas.width/2 + x, canvas.height/2 - y/5)
         ctx.rotate( i +  Math.PI * 2/bufferLength);
         const hue = i / 6 + 200;
         ctx.fillStyle = 'hsl(' + hue + ',100%, 50%)';
         ctx.strokeStyle = 'hsl(1, 100%, ' + i/2 + '%)';

         ctx.fillRect(x, y, barWidth, barHeight);
         ctx.strokeRect(x, y, barWidth, barHeight);
         ctx.restore();
         x += barWidth;
      }
    };

  
    function askQuestion(button) {
        var question = button.innerText;
        var answer = button.getAttribute("text");
        
        document.getElementById('questionText').textContent = question;
        document.getElementById('answerText').textContent = answer;
    
        if (question === "What should I bring?") {
            document.element('modalChecklistBtn').hidden = false;
        }
    };

    //Card Effect

    function map(val, minA, maxA, minB, maxB) {
        return minB + ((val - minA) * (maxB - minB)) / (maxA - minA);
      }
      
      function Card3D(card, ev) {
        let img = card.querySelector('img');
        let imgRect = card.getBoundingClientRect();
        let width = imgRect.width;
        let height = imgRect.height;
        let mouseX = ev.offsetX;
        let mouseY = ev.offsetY;
        let rotateY = map(mouseX, 0, 180, -25, 25);
        let rotateX = map(mouseY, 0, 250, 25, -25);
        let brightness = map(mouseY, 0, 250, 1.5, 0.5);
        
        img.style.transform = `rotateX(${rotateX}deg) rotateY(${rotateY}deg)`;
        img.style.filter = `brightness(${brightness})`;
      }
      
      var cards = document.querySelectorAll('.card3d');
      
      cards.forEach((card) => {
        card.addEventListener('mousemove', (ev) => {
          Card3D(card, ev);
        });
        
        card.addEventListener('mouseleave', (ev) => {
          let img = card.querySelector('img');
          
          img.style.transform = 'rotateX(0deg) rotateY(0deg)';
          img.style.filter = 'brightness(1)';
        });
      });
